import React from 'react'
import Head from 'next/head';
import ListingWrapper, {
    CheckVisaWrapper,
    BreadcrumbWrapper
} from 'container/Listing/Listing.style';
import { Select, Breadcrumb, Divider } from 'antd';
import CheckVisaItem from 'components/CheckVisa/CheckVisa';

const { Option } = Select;

function onChange(value) {
    console.log(`selected ${value}`);
}

function onBlur() {
    console.log('blur');
}

function onFocus() {
    console.log('focus');
}

function onSearch(val) {
    console.log('search:', val);
}

export default function CheckVisa() {

    const countries = [
        { name : 'Hàn Quốc (Korea)' },
        { name : 'Nhật Bản (Janpan)' },
        { name : 'Đài Loan (Taiwan)' },
        { name : 'Trung Quốc (China)' },
        { name : 'Hồng Kông (Hongkong)'},
        { name : 'Ma Cao (Macau)'},
        { name : 'Nga (Russia)'},
        { name : 'Châu âu (Schengen)'},
        { name : 'Úc (Australia)'},
        { name : 'New Zealand'},
        { name : 'Canada'},
        { name : 'Mỹ (America)'},
        { name : 'Ấn độ (India)'},
        { name : 'Dubai AUE'}
    ]; 
    return (
        <ListingWrapper>
            <Head>
                <title>Kiểm tra tỉ lệ đậu visa</title>
            </Head>
            <BreadcrumbWrapper>
                <Breadcrumb>
                    <Breadcrumb.Item href="/">
                        <span>Trang chủ</span>
                    </Breadcrumb.Item>
                    <Breadcrumb.Item href="/blog">
                        <span>Kiểm tra tỉ lệ đậu visa</span>
                    </Breadcrumb.Item>
                </Breadcrumb>
                <Divider />
            </BreadcrumbWrapper>
            <CheckVisaWrapper>
                <CheckVisaItem
                    question='Câu 1 : Chọn Quốc Gia muốn xin visa : '
                    
                >
                    <Select
                        showSearch
                        style={{ width: 200 }}
                        placeholder="Chọn Quốc Gia muốn xin visa"
                        optionFilterProp="children"
                        onChange={onChange}
                        onFocus={onFocus}
                        onBlur={onBlur}
                        onSearch={onSearch}
                        filterOption={(input, option) =>
                            option.children.toLowerCase().indexOf(input.toLowerCase()) >= 0
                        }
                    >
                        {countries.map(item => <Option value={item}>{item.name}</Option>) })
                    </Select>
                </CheckVisaItem>
                <CheckVisaItem
                    question='Câu 2 : Mục đích xin visa: '
                >
                    <Select
                        showSearch
                        style={{ width: 200 }}
                        placeholder="Chọn Quốc Gia muốn xin visa"
                        optionFilterProp="children"
                        onChange={onChange}
                        onFocus={onFocus}
                        onBlur={onBlur}
                        onSearch={onSearch}
                        filterOption={(input, option) =>
                            option.children.toLowerCase().indexOf(input.toLowerCase()) >= 0
                        }
                    >
                        <Option value="jack">Jack</Option>
                        <Option value="lucy">Lucy</Option>
                        <Option value="tom">Tom</Option>
                    </Select>
                </CheckVisaItem>
                <CheckVisaItem
                    question='Câu 3 : Thông tin về công việc : '
                >
                    <Select
                        showSearch
                        style={{ width: 200 }}
                        placeholder="Chọn Quốc Gia muốn xin visa"
                        optionFilterProp="children"
                        onChange={onChange}
                        onFocus={onFocus}
                        onBlur={onBlur}
                        onSearch={onSearch}
                        filterOption={(input, option) =>
                            option.children.toLowerCase().indexOf(input.toLowerCase()) >= 0
                        }
                    >
                        <Option value="jack">Jack</Option>
                        <Option value="lucy">Lucy</Option>
                        <Option value="tom">Tom</Option>
                    </Select>
                </CheckVisaItem>
                <CheckVisaItem
                    question='Câu 4 : Thông tin về nhân thân : '
                >
                    <Select
                        showSearch
                        style={{ width: 200 }}
                        placeholder="Chọn Quốc Gia muốn xin visa"
                        optionFilterProp="children"
                        onChange={onChange}
                        onFocus={onFocus}
                        onBlur={onBlur}
                        onSearch={onSearch}
                        filterOption={(input, option) =>
                            option.children.toLowerCase().indexOf(input.toLowerCase()) >= 0
                        }
                    >
                        <Option value="jack">Jack</Option>
                        <Option value="lucy">Lucy</Option>
                        <Option value="tom">Tom</Option>
                    </Select>
                </CheckVisaItem>
                <CheckVisaItem
                    question='Câu 5 : Thông tin về khả năng tài chính : '
                >
                    <Select
                        showSearch
                        style={{ width: 200 }}
                        placeholder="Chọn Quốc Gia muốn xin visa"
                        optionFilterProp="children"
                        onChange={onChange}
                        onFocus={onFocus}
                        onBlur={onBlur}
                        onSearch={onSearch}
                        filterOption={(input, option) =>
                            option.children.toLowerCase().indexOf(input.toLowerCase()) >= 0
                        }
                    >
                        <Option value="jack">Jack</Option>
                        <Option value="lucy">Lucy</Option>
                        <Option value="tom">Tom</Option>
                    </Select>
                </CheckVisaItem>
                <CheckVisaItem
                    question='Câu 6 : Tài sản cố định : '
                >
                    <Select
                        showSearch
                        style={{ width: 200 }}
                        placeholder="Chọn Quốc Gia muốn xin visa"
                        optionFilterProp="children"
                        onChange={onChange}
                        onFocus={onFocus}
                        onBlur={onBlur}
                        onSearch={onSearch}
                        filterOption={(input, option) =>
                            option.children.toLowerCase().indexOf(input.toLowerCase()) >= 0
                        }
                    >
                        <Option value="jack">Jack</Option>
                        <Option value="lucy">Lucy</Option>
                        <Option value="tom">Tom</Option>
                    </Select>
                </CheckVisaItem>
            </CheckVisaWrapper>
        </ListingWrapper>
    )
}
